import { Global } from '@emotion/core'

import { Header } from '../header';
import { Footer } from '../footer';

import {
  StyledLayout,
  LinesWrapper,
  Lines,
  MainLayout,
  GlobalStyles,
  ResetStyles
} from './layout.styles'


interface Props {
  children: any;
}



export const Layout = ({children}: Props) => {
  return (
    <>
      <Global styles={GlobalStyles} />
      <Global styles={ResetStyles} />
      <StyledLayout>
        <LinesWrapper>
          <Lines />
          <Lines />
          <Lines />
          <Lines />
          <Lines />
        </LinesWrapper>
        <Header />
        <MainLayout>
          {children}
        </MainLayout>
        <Footer />
      </StyledLayout>
    </>
  )
}
